null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"56678","type":"CustomJS"},{"attributes":{},"id":"56393","type":"AllLabels"},{"attributes":{},"id":"56301","type":"LinearScale"},{"attributes":{"axis_label":"Volume","coordinates":null,"formatter":{"id":"56573"},"group":null,"major_label_policy":{"id":"56742"},"minor_tick_line_color":null,"ticker":{"id":"56545"}},"id":"56544","type":"LinearAxis"},{"attributes":{},"id":"56308","type":"BasicTicker"},{"attributes":{"label":{"value":"obv(C,V)"},"renderers":[{"id":"56659"}]},"id":"56673","type":"LegendItem"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPxK4MZei9PE/qQIjWbl/8D/F9XV49SHwP2xu677oMPE/BA9gFM/S9T+MqZgnKtz2P7oMKPJXAPc/aF9g+iJZ/D+qGGmw49gAQPk8rHcRiQFAm02nFClnAUAKjKQvSN4AQN1gH5dcaAFAP5bM9hJbAUCE9a4BsrkBQMKQuQ9QxAFA7ryYb49oAUACiXLeTPz7P2shMWoKGfc//AZQ61H+9z83x83eaNn4P1i5a4uzLPs/gt13CswR+T9Py5HQ93X5P9FO89pUKfY/CzYIxRDm+D9tGaHL4z75PwQPgzHDLPo/r9dByWZK9z8B5TWt4kH5PyiVYux6mvQ/v9Ace0Wa9D/Coq4Rolv0PyFggqKByvI/ONu0zv1P9D8+CIrt7pPxP7FkCTXTnPU/avDUgn7l9D+aqcuTFXbzP7NVeyiq2PI/wCIMKDu+8j9XZo6chbXxP3jX9ONHXPE//ry0rXg28D/uOC8rEY7xP2Ktw4OON/Q/I8XhoHQR8z9BiD48qEbyP+wEAyPerPE/obMfJP5i8T+bonYH2lDzP014cCaY6/E/Rdu75X6a8T+EN9por23vPxtPyzmp0O8/8MYDAH127z+miqs3NbHtP7P11hmWAus/68aFzFPW6j9QptyKrRDsP77QIHq6+es/aTk+MQlt7D8mx50e1ZrsP+Pi3WLJJPA/leYScqzQ8D8wyliHq4DwP/SZSCt0Ru8/DXvzegN07D9pxTDbGnLrP/4LQCFhH+w/zJCAj/O+6z/CsxPvAzXtP6s/t/2ZIe0/tONyJqzb7T9vx/7etkbuPxz057L2avE/FceTgiRt8z/kuJg8htHzP5u56TVHy/E/HScb62zy8D/WtZvGLjP2PzTPKI3yLfY/4rxlprCf9z/6KIMJrvP4Pz3eksfrM/g/eVm2Q1vy9D/t+2iFxtfzP79hP2KhxPM/DesY1FcD8z/hv+0GFdjzP/o3UANhuPM/gcpebTF28j9thyuHAa7yP/FqG4foNvQ/hctki1IH9T8KJ6XQZ7z1PwlOoiXyiPc/ni53crmS9j8YzJA1VbH3P4nYTYZ
